class Solution(object):
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        i=0
        n = len(s)
        max_len =0
        length =0
        numeric = [0]*255
        while(i<n):
            j = i
            while(j< n):
                if numeric[ord(s[j])] is 0:
                    numeric[ord(s[j])] = 1
                    length += 1
                    j = j+1
                else:
                    break
            if length > max_len:
                max_len = length
            if max_len > n-i:
                return max_len
            numeric = [0]*255
            length = 0
            i = i+1

        if max_len < length:
            return length
        return max_len

    def method2(self, s):
        i=0
        n = len(s)
        max_len =0
        length =0
        sub = ""
        while(i<n):
            j = i
            while(j< n):
                if s[j] not in sub:
                    sub += s[j]
                    length +=1
                    j = j+1
                else:
                    break
            if length > max_len:
                max_len = length
            if max_len > n-i:
                return max_len
            length = 0
            i = i+1
            sub = ""
        if max_len < length:
            return length
        return max_len
    # Python program to find the length of the longest substring
# without repeating characters
NO_OF_CHARS = 256

def longestUniqueSubsttr(string):
    n = len(string)
    cur_len = 1        # To store the lenght of current substring
    max_len = 1        # To store the result

    # Initialize the visited array as -1, -1 is used to indicate
    # that character has not been visited yet.
    visited = [-1] * NO_OF_CHARS

    # Mark first character as visited by storing the index of
    # first character in visited array.
    visited[ord(string[0])] = 0

    # Start from the second character. First character is already
    # processed (cur_len and max_len are initialized as 1, and
    # visited[str[0]] is set
    for i in xrange(1,n):
        prev_index = visited[ord(string[i])]

        # If the currentt character is not present in the already
        # processed substring or it is not part of the current NRCS,
        # then do cur_len++
        if prev_index == -1 or (i - cur_len > prev_index):
            cur_len+=1

        # If the current character is present in currently considered
        # NRCS, then update NRCS to start from the next character of
        # previous instance.
        else:
            # Also, when we are changing the NRCS, we should also
            # check whether length of the previous NRCS was greater
            # than max_len or not.
            if cur_len > max_len:
                max_len = cur_len

            cur_len = i - prev_index

        # update the index of current character
        visited[ord(string[i])] = i

    # Compare the length of last NRCS with max_len and update
    # max_len if needed
    if cur_len > max_len:
        max_len = cur_len

    return max_len

def longestSubString(s):
    if s is "":
        return 0
    n = len(s)
    curr_len = 1
    max_len = 1
    v = [-1] *256
    v[ord(s[0])] = 0
    for i in xrange(1,n):
        prev = v[ord(s[i])]
        if prev == -1 or (i-curr_len > prev):
            curr_len += 1
        else:
            if curr_len > max_len:
                max_len = curr_len
            curr_len = i - prev
        v[ord(s[i])]= i

    if curr_len > max_len:
        return curr_len
    return max_len

